public float rotationSpeedX = 0;
    public float rotationSpeedY = 1;
    public float rotationSpeedZ = 0;
    public Vector3 currentRotation;

    void Start() {
        Debug.Log("Start()");
        //transform.rotation.eulerAngles = new Vector3(0, 0, 0);
        transform.rotation = Quaternion.Euler(0, 0, 0);
        currentRotation = transform.eulerAngles;
    }
    void FixedUpdate() {
        currentRotation.x += rotationSpeedX * Time.deltaTime;
        currentRotation.y += rotationSpeedY * Time.deltaTime;
        currentRotation.z += rotationSpeedZ * Time.deltaTime;

        if(currentRotation.y >= 359 - rotationSpeedY)
            currentRotation.y = 0;
        if(currentRotation.x >= 359 - rotationSpeedY)
            currentRotation.x = 0;
        if(currentRotation.z >= 359 - rotationSpeedY)
            currentRotation.z = 0;

        transform.eulerAngles = currentRotation;
    }
    void OnDrawGizmos() {
        Debug.Log("OnDrawGizmos()");
    }

void Shoot ()
    {
        muzzleFlash.Play ();
        RaycastHit hit;

        if (Physics.Raycast (fpsCam.transform.position, fpsCam.transform.forward, out hit, range)) 
        {
            Debug.Log (hit.transform.name);

            Target target = hit.transform.GetComponent<Target> ();
            if (target != null) {
                target.TakeDamage (damage);
                Debug.Log (hit.transform.name + " was hit for "+damage+" damage points");
            }
            if (hit.rigidbody != null) {
                hit.rigidbody.AddForce (-hit.normal * damage * 100);
            }
            GameObject impactGO = Instantiate (impactEffect, hit.point, Quaternion.LookRotation (hit.normal));
            Destroy (impactGO, 1);
        }
    }

