import java.io.File;
import java.io.FileInputStream;
import java.io.FileNotFoundException;
import java.io.FileOutputStream;
import java.io.IOException;

public class Converter {
    public static void main(String[] args) throws Exception{
        convert(new File("in.txt"), new File("out.txt"));
    }
    public static void convert(File steamVersion, File oldVersion) throws IOException{
        oldVersion.createNewFile();
        if(!steamVersion.exists() || !steamVersion.canRead()) 
            throw new FileNotFoundException("Steam version file don't exist or unreadable!");
        if(!oldVersion.exists() || !oldVersion.canWrite())
            throw new IOException("Cannot write to old version file!");
        FileInputStream is = new FileInputStream(steamVersion);
        FileOutputStream os = new FileOutputStream(oldVersion);
        boolean ignoreWrite = false;
        System.out.println("Preparations made, starting conversions!");
        while(is.available() >= 0){
            char c = (char) is.read();
            if(c == '_') ignoreWrite = true;
            if(c == '|' || c == ',') ignoreWrite = false;
            if(!ignoreWrite) os.write(c);
        }
        System.out.println("Done converting, cleaning up!");
        is.close(); 
        os.close();
    }
}
