public class Node {
    public int gCost, hCost;
    public NodeType type = NodeType.Normal;
    public Node(int gCost, int hCost, NodeType type){
        this.gCost = gCost;
        this.hCost = hCost;
        this.type = type;
    }
    public int getFCost(){
        return gCost + hCost;
    }
}
enum NodeType{
    Normal, Obstacle, Start, Stop
}
